#this python code converts any DNA sequence to RNA Seq
def transcription(sequence): 
    complementary = ""
    for char in sequence:
      if char=="A":
        complementary += "U"
      if char=="T":
        complementary += "A"
      if char=="G":
        complementary += "C"
      if char=="C":
        complementary += "G"
    return complementary

def Complement(sequence): 
    complementary = ""
    for char in sequence:
      if char=="A":
        complementary += "T"
      if char=="T":
        complementary += "A"
      if char=="G":
        complementary += "C"
      if char=="C":
        complementary += "G"
    return complementary

sequence1=""
print("sequence1:"+transcription(Complement(sequence1)))
sequence2=""
print("sequence2:"+transcription(Complement(sequence2)))
sequence3=""
print("sequence3:"+transcription(Complement(sequence3)))